		z-index: 2; 
	}
  
.circleNot {
		position: absolute;
		left: 15%;
		padding: 1%;
		margin-top: 14%;
		background-color: #2eaa1c;
		height: 0.1px;
		width: 0.1px;
		border-radius: 100%;
		z-index: 999 !important;
	}

.circlePM {
		position: absolute;
		left: 15%;
		padding: 1%;
		margin-top: 14%;
		background-color: #e7112f;
		height: 0.1px;
		width: 0.1px;
		border-radius: 100%;
		z-index: 999 !important;
	}


nav[role="off-canvas"] {
		position: relative;
		width: 10em;
		margin: 0 auto;
		transition-property: left, opacity, box-shadow;
	}
nav[role="off-canvas"] a {
		color: #fff;
		text-decoration: none;
		font: 12px 'Open Sans', sans-serif;
		transition: color .3s ease-in-out;
		display: table-cell;
		vertical-align: middle;
	}
	
nav[role="off-canvas"] ul {
		padding: 0;
		margin: 0 auto;
		width: 100%;
	}
	
nav[role="off-canvas"] ul > li {
		float: left;
		padding: .55em .55em;
		width: 8em;
		height: 8em;
		margin: .5em;
		opacity: .8;
		text-transform: uppercase;
		display: table;
	 
		cursor: pointer;
		text-align: center;
	
		transition-timing-function: ease-in-out;
		transition-property: box-shadow, color, opacity, padding-left;
		cursor: pointer;
	}

nav[role="off-canvas"] ul > li:hover {
		color: #fff;
		opacity: 1;
	}

nav[role="off-canvas"] ul > li:hover > a {
		color: #ffb300;
	}

nav[role="off-canvas"] ul > li:visited > a {
		color: #ffb300;
	}


@media screen and (max-width: 44em) {
html,
body {
		margin: 0;
		overflow-x: hidden;
	}

nav[role="off-canvas"] {
		position: absolute;
		top: 3em;
		left: -10em;
		width: 10em;
		opacity: 0;
		background: #0A0A0A;

	}
	
nav[role="off-canvas"] ul > li {
		height: 100%;
		width: 100%;
		text-align: left;
		margin: 0;
	}

label {
		display: block;
	}

label:after {
		position: absolute;
		right: .25em;
		top: 0;
		content: "\2261";
		font-size: 1.8em;
	}

label:hover,input:checked ~ label {
		color: #ffb300;
	}

input:checked ~ nav[role="off-canvas"] {
		opacity: 1;
		left: 0;
		box-shadow: -20em 0 0 50em rgba(0, 0, 0, 0.35);
		z-index:1;
	}
	
input:checked ~ nav[role="off-canvas"] ul > li {
		padding: .55em .55em .55em 1.5em;
	}

input:checked ~ .content {
		margin-left: 11.5em;
		margin-right: -11.5em;
		position: fixed;
	}
}

.avatar {
		float: left;
		margin-top: 1em;
		margin-right: 1em;
		position: relative;

		-webkit-border-radius: 50%;
		-moz-border-radius: 50%;
		border-radius: 50%;

		-webkit-box-shadow: 0 2px 5px 4px rgba(0,0,0,.2);
		-moz-box-shadow:  0 2px 5px 4px rgba(0,0,0,.2);
		box-shadow: 0 2px 5px 4px rgba(0,0,0,.2);
	}	
.scrollup {
